import './App.css';

function App() {
    return (
        <div className={"wrapper"}>
            <header className={"header"}>
                <img src="http://autodrive.org.ua/wp-content/uploads/2018/11/final-logo-example.png" alt="logo"/>
            </header>
            <nav className={".nav"}>
                <ul>
                    <li><a href="/Profile"></a></li>
                    <li><a href="Messages"></a></li>
                    <li><a href=""></a></li>
                </ul>
            </nav>
            <div className={"content"}>
                Main content
            </div>
        </div>
    );
}

export default App;
